('2436','2','8364','Apartamentos  Nova Canaima S.L.',Null,'Neue Apartmentanlage in Palma Nova mit 1 Schlafzimmer Apartments','34178','Palma Nova liegt in der Gemeinde Calvia im Südwesten Mallorcas. Von hier aus hat man nur wenige Fahrminuten zur Stadt Palma, diversen Golfplätzen, Jachthäfen, Supermärkten und Restaurants. Die Apartmentanlage wird im Sommer 2016 fertig erstellt sein und bietet 36 modern gestaltete Einschlafzimmer Apartments mit ausgestatteten Badezimmern, Wohn-Esszimmer und offener Einbauküche. Die Apartments sind ausgestattet mit Aufzug,  isoliertem Mauerwerk, Klimaanlage w/k (ist vorinstalliert und kostet 2.050€ extra) und Doppelglasfenster. 18 Apartments haben einen Meerblick. Zum Strand sind es nur 50m.','34179','170000','106','2016-03-16 15:20:23','106','2016-03-16 15:21:16',Null,'2583','106','1212',1,'1','0',Null,Null,Null,'34180',Null,'0','0','0',Null,'2016-03-16 15:27:59',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'34181',Null,'34182',Null,'34183',Null,'34184','Ansprechpartner Anette  971 41 81 14','34185','0',0,'0');
